import React from 'react';

const Infernoguard = () => {
  return (
    <div>
      <h1>Paid Data science Internship</h1>
      <>As part of the two person risk assesment model development team, I work on the backend. I have set up the AWS environment for running the model based on post request. I have written code to convert point data to geographical representation. This will inform a client about the areas of greatest fire risk on their property.</>
    </div>
  );
};

export default Infernoguard;
